import "./App.css";
import "./index.css";
import Movies from "./Movies";
import { BrowserRouter as Router, Switch, Rout } from "react-router-dom";

function App() {
  return (
    <Router>
      <div className="App">
        <Route path="/movies" component={Movies} />
        {/* <Route path="/" component={}/> */}
      </div>
    </Router>
  );
}

export default App;
